import store from "./redux-store";

const FOLLOW = 'FOLLOW';
const UNFOLLOW = 'UNFOLLOW';
const SET_USERS = 'SET_USERS'

let initState = {
  users: [
      {id:1, photoUrl:'data:image/jpeg;base64,',
          followed:true, firstName:'Dima', lastName: 'K.', status:'Hello, boy!', location:{city: 'Moscow', country:'Russia'}},
      {id:2, photoUrl:'data:image/jpeg;base64,',
          followed:false, firstName:'Elena', lastName: 'A.', status:'Worry, ass!', location:{city: 'Moscow', country:'Russia'}},
      {id:3, photoUrl:'data:image/jpeg;base64,',
          followed:true, firstName:'Anna', lastName: 'R.', status:'My hump!', location:{city: 'Moscow', country:'Russia'}},
      {id:4, photoUrl:'data:image/jpeg;base64,',
          followed:false, firstName:'Maksim', lastName: 'H.', status:'Tresh!', location:{city: 'Moscow', country:'Russia'}}
  ]
}

const usersReducer = (state = initState, action) =>{

   switch (action.type){
       case FOLLOW:{
           return {
               ...state,
                users:state.users.map(u=>{
                    if(u.id === action.userId){
                        return {...u, followed: true}
                    } return u;
                })}
       }
       case UNFOLLOW:{
           return {
               ...state,
               users:state.users.map(u=>{
                   if(u.id === action.userId){
                       return {...u, followed: false}
                   } return u;
               })}
       }
       case SET_USERS:{
           return {...state, users: [...state.users, ...action.users]}
       }
       default: return state;
   }
}

export const followAC = (userId)=> ({type:FOLLOW, userId})
export const unfollowAC = (userId)=> ({type:UNFOLLOW, userId})
export const setUserAC = (users) =>({type:SET_USERS, users})

export default usersReducer;